INSERT INTO `mdl_cache_text` (`id`, `md5key`, `formattedtext`, `timemodified`) VALUES
(1, '7ca88a3032cf983b183c02f4e3534bb3', '<p>En esta sección encontrará varios ajustes que permiten modificar muchos de los colores encontrados en este tema gráfico.</p>\n', 1399094397),
(2, '62846d5032442f06aeef6756aa9b3799', '<p>Esto genera un carrusel de hasta 4 diapositivas que le permiten promover elementos importantes de su sitio.</p>\n', 1399094397),
(3, '98f8f8c12a971ad7fa7b44665ab7ed97', '<p>This adds a custom content area inbetween the Slideshow and the Marketing boxes for your own custom content</p>\n', 1399094397),
(4, '3f00ce526160ce5ffce3a005e773a315', '<p>Este tema ofrece la opción de habilitar tres "spots publicitarios" justo debajo del carrusel de diapositivas. Estos le permitirán identificar fácilmente información importante para sus usuarios y proveer enlaces directos.</p>\n', 1399094397),
(5, '5f90e2089ef6f58ec567c0accaf11859', '<p>Provea enlaces directos a las principales redes sociales que usa para promover su marca. Esta sección aparecerá en la cabecera de todas las páginas.</p>\n', 1399094397),
(6, '50d7ff2a902123b18be798cb87331f28', '<p>If enabled this will allow you to set icons for each category of course.</p>\n', 1399094397),
(7, '566e0767b389173d4dc17f700333e1eb', '<p>¿Posee una aplicación registrada en App Store o Google Play Store? Ofrezca aquí en enlace para que sus usuarios puedan aprovecharlas</p>\n', 1399094397),
(8, '265d97fc24eeb5ef3640658485f43278', '<p>Esto mostrará una alerta (o múltiple) en tres estilos diferentes para los usuarios en la página principal de Moodle. Por favor, recuerde que debe desactivar estos cuando ya no sean necesarios.</p>\n', 1399094397),
(9, 'b26b85b57f547b75cd6e40dacc38d35b', '<p>Aquí puede activar Google Analytics para su sitio moodle. Usted tendrá que registrarse para obtener una cuenta gratuita en el sitio de Google Analytics (<a href="http://analytics.google.com" target="_blank"> http://analytics.google.com &lt;/ a&gt; )</a></p>\n', 1399094397),
(10, '5dc6a8d226bc87538d24efae97c947bd', '<p>Cuando se habilitan reproductores en estas configuraciones, los archivos pueden incrustarse empleando el filtro multimedia (si está habilitado) o mediante un recurso de Archivo o URL con la opción de incrustar. Cuando no están habilitados, estos formatos no son incrustables y los usuarios pueden descargarlos manualmente o seguir las ligas hacia estos recursos.</p>\n\n<p>Cuando dos reproductores soportan el mismo formato, el habilitar ambos aumenta la compatibilidad entre diferentes dispositivos como teléfonos móviles. Es posible aumentar aún más la compatibilidad al proporcionar archivos múltiples en diferentes formatos para cada clip de audio  o video.</p>\n', 1399094397),
(11, 'beae5e6deaac51d5ab99c85fa11f47ae', '<p>En esta sección encontrará varios ajustes que permiten modificar muchos de los colores encontrados en este tema gráfico.</p>\n', 1399094418),
(12, 'e6fe47fd880bb58615128d3dfe3ddf21', '<p>Esto genera un carrusel de hasta 4 diapositivas que le permiten promover elementos importantes de su sitio.</p>\n', 1399094418),
(13, '303d7553c871723ba014a3bb07b2a531', '<p>This adds a custom content area inbetween the Slideshow and the Marketing boxes for your own custom content</p>\n', 1399094418),
(14, '9a449f68ba0c1f87a2f78b4c3fdccd1f', '<p>Este tema ofrece la opción de habilitar tres "spots publicitarios" justo debajo del carrusel de diapositivas. Estos le permitirán identificar fácilmente información importante para sus usuarios y proveer enlaces directos.</p>\n', 1399094419),
(15, '22a07caae8f134d28a5bb50dc1d24d86', '<p>Provea enlaces directos a las principales redes sociales que usa para promover su marca. Esta sección aparecerá en la cabecera de todas las páginas.</p>\n', 1399094419),
(16, 'af09922b9f963a293d22cc0d3606ba0b', '<p>If enabled this will allow you to set icons for each category of course.</p>\n', 1399094419),
(17, '4238070bc690c9e9a8726365d60d01fb', '<p>¿Posee una aplicación registrada en App Store o Google Play Store? Ofrezca aquí en enlace para que sus usuarios puedan aprovecharlas</p>\n', 1399094419),
(18, 'a16ae1198df3723531e06e1d757b206f', '<p>Esto mostrará una alerta (o múltiple) en tres estilos diferentes para los usuarios en la página principal de Moodle. Por favor, recuerde que debe desactivar estos cuando ya no sean necesarios.</p>\n', 1399094419),
(19, 'a5a0c0b2881127fee1ab6b895b9da8ab', '<p>Aquí puede activar Google Analytics para su sitio moodle. Usted tendrá que registrarse para obtener una cuenta gratuita en el sitio de Google Analytics (<a href="http://analytics.google.com" target="_blank"> http://analytics.google.com &lt;/ a&gt; )</a></p>\n', 1399094419),
(20, '85b66d3d96cd2710a4d175b7ec8925bf', '<p>Cuando se habilitan reproductores en estas configuraciones, los archivos pueden incrustarse empleando el filtro multimedia (si está habilitado) o mediante un recurso de Archivo o URL con la opción de incrustar. Cuando no están habilitados, estos formatos no son incrustables y los usuarios pueden descargarlos manualmente o seguir las ligas hacia estos recursos.</p>\n\n<p>Cuando dos reproductores soportan el mismo formato, el habilitar ambos aumenta la compatibilidad entre diferentes dispositivos como teléfonos móviles. Es posible aumentar aún más la compatibilidad al proporcionar archivos múltiples en diferentes formatos para cada clip de audio  o video.</p>\n', 1399094419);
